
<hr />

<h1><a id="{{ .Version }}">{{ .Version }}</a></h1>
Generated from apisetschema.dll with md5: {{ .md5 }}

<table>
    <tr><th>Apiset</th><th>host</th></tr>
{{ range .namespaces }}
    <tr>
        <td>{{ .name }}</td>
        <td>{{ .host }}
            {{ if .alt_name }}
             <br />({{ .alt_name }} -> {{ .alt_host }})
            {{ end }}
        </td>
    </tr>
{{ end }}
</table>
